import React from "react";
import Footer from "../subcomponents/Footer";

import mealImage from "../../images/burger_fries.png";

const BasicItemPage = () => {
  return(
    <div className="page-container">
      <div className="menu-item-top-container">
        <img src={mealImage} alt="Meal"></img>
      </div>
      <div className="menu-item-middle-container">

      </div>
      <div className="menu-item-bottom-container">
        <button className="menu-item-button ui button">Customize</button>
        <button className="menu-item-button ui button">ADD</button>
      </div>
      <Footer />
    </div>
  );
}

export default BasicItemPage;
